import { NavLink } from 'react-router-dom';

const NavBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <NavLink to="/Login"><button onClick = "#Login" id = "button">Login lol</button></NavLink>
                    <NavLink to="/Home"><button onClick = "#Home" id = "button">Home lol</button></NavLink>
                    <NavLink to="/Calculate"><button onClick = "#Calculate" id = "button">Calculate lol</button></NavLink>
                    <NavLink to="/Contact"><button onClick = "#Contact" id = "button">Contact lol</button></NavLink>
                </li>
            </ul>
        </nav>
    )
}

export default NavBar;
